import React, { useState, useEffect } from 'react'
import {Provider} from 'react-redux'
import {NavLink} from 'react-router-dom'
import {PersistGate} from 'redux-persist/integration/react'
import {store, persistor} from './redux/store'
import {useStore} from 'react-redux'
import SignupForm from './components/signupModal'
import ImageDetails from './screen/ImageDetails'
import UploadScreen from './screen/UploadScreen'
import LoginForm from './components/Login'
import UploadForm from './components/UploadForm'
import Loading from './components/Loading'
import ScreenWrapper from './screen/ScreenWrapper'


import './styles/App.css'
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";
import ImageList from '../src/screen/ImageList'
//import auth from './redux/reducer/authReducer'


function App() {



  return (

    <Provider store={store}>
      <PersistGate loading={<Loading />} persistor={persistor}>

      </PersistGate >
  </Provider>
  )
}

export default App;
